// DenunciasScreen.jsx

import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from 'react-native';

const DenunciasScreen = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <TouchableOpacity
        style={styles.denunciaButton}
        onPress={() => navigation.navigate('DenunciaDetail', { tipo: 'Denuncias Penales', descripcion: 'Relacionadas con actividades delictivas. Pueden incluir delitos como robo, fraude, agresión, etc.' },{ tipo: 'Denuncias Civiles', descripcion: '' })}
      >
        <Text style={styles.denunciaButtonText}>Denuncias Penales</Text>
      </TouchableOpacity>
      {/* Agrega más botones de denuncias aquí */}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  denunciaButton: {
    backgroundColor: 'red',
    padding: 10,
    borderRadius: 10,
    marginBottom: 10,
  },
  denunciaButtonText: {
    color: 'white',
    fontSize: 18,
  },
});

export default DenunciasScreen;
